- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: "Principal Component Analysis (PCA) is a method of data analysis that can\
      \ capture most of the volatility in a data set in just a few components. PCA\
      \ splits the time series stock data into a weighted linear function of several\
      \ matrices. These matrices are called principal components and are ordered by\
      \ which component captures the most variation in the data set (Jaadi, 2021).\
      \ If all but the 2 or 3 most-heavily weighted terms are discarded, much of the\
      \ variance - called volatility in finance - will be captured in these components.\
      \ For the purpose of this project we will use as many principal components as\
      \ are needed to capture 90 percent of the variation in the data. Once these\
      \ components have been determined, we can project the principal components back\
      \ into a new predictive data set that should capture most of the variation in\
      \ our original data set. We can then calculate the euclidean distance between\
      \ the original data and this projected data; that distance represents the volatility\
      \ of each stock. Choosing the ten or so most volatile stocks is a good aggressive\
      \ strategy, while doing the same for the least volatile stocks is a good conservative\
      \ strategy. We will create two separate portfolios consisting of the ten most\
      \ volatile stocks and the ten least volatile stocks based on their euclidean\
      \ norm from the original data set. \n", font_size: null, font: '', spacing_above: small,
    icon_align: left, spacing_below: large, italic: false, background: '', bold: false,
    underline: false, icon: ''}
  name: label_1
  layout_properties: {grid_position: 'KYZCTW,SGHRXE'}
